import React from 'react';
import './App.css';
import nav from './components/navBar/navbar.js';
import {Route,Routes} from 'react-router-dom'

function app() {

    return (
      <div>
       <nav />

          <Routes>
            <Route path='/' component={nav}/>
          </Routes>



      </div>
    );
}


export default app;
